import './App.css';

function App() {
  // 게시글 목록을 배열로 만듭니다.
  const posts = [
    { id: 1, title: '첫 번째 글' },
    { id: 2, title: '두 번째 글' },
    { id: 3, title: '세 번째 글' }
  ];

  return (
    <div className="App">
      <h1>게시판</h1>
      <ul>
        {posts.map(post => (
          <li key={post.id}>{post.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
